// Cause
#[derive(Clone)]
pub enum Cause {
    RadioNetwork(CauseRadioNetwork),
    Transport(CauseTransport),
    Protocol(CauseProtocol),
    Misc(CauseMisc),
}

impl APerElement for Cause {
    fn from_aper(decoder: &mut Decoder, _constraints: Constraints) -> Result<Self, DecodeError> {
        match u8::from_aper(decoder, UNCONSTRAINED)? {
            0 => Ok(Self::RadioNetwork(CauseRadioNetwork::from_aper(
                decoder,
                UNCONSTRAINED,
            )?)),
            1 => Ok(Self::Transport(CauseTransport::from_aper(
                decoder,
                UNCONSTRAINED,
            )?)),
            2 => Ok(Self::Protocol(CauseProtocol::from_aper(
                decoder,
                UNCONSTRAINED,
            )?)),
            3 => Ok(Self::Misc(CauseMisc::from_aper(decoder, UNCONSTRAINED)?)),
            4 => Err(DecodeError::NotImplemented),
            _ => Err(DecodeError::InvalidChoice),
        }
    }
    fn to_aper(&self, enc: &mut Encoding, _constraints: Constraints) -> Result<(), EncodeError> {
        match self {
            Self::RadioNetwork(x) => {
                (0 as u8).to_aper(enc, UNCONSTRAINED)?;
                x.to_aper(enc, UNCONSTRAINED)?;
            }
            Self::Transport(x) => {
                (1 as u8).to_aper(enc, UNCONSTRAINED)?;
                x.to_aper(enc, UNCONSTRAINED)?;
            }
            Self::Protocol(x) => {
                (2 as u8).to_aper(enc, UNCONSTRAINED)?;
                x.to_aper(enc, UNCONSTRAINED)?;
            }
            Self::Misc(x) => {
                (3 as u8).to_aper(enc, UNCONSTRAINED)?;
                x.to_aper(enc, UNCONSTRAINED)?;
            }
        }
        Ok(())
    }
}

